    def main(self, AUDIO_DATA, AUDIO_FILE):
        # 数据预处理
        pre_audio_data = self.pre_data(AUDIO_DATA)
        # 计算cir
        CIRData = self.cal_cir_main(pre_audio_data)
        # 计算dcir
        diffCIR = self.cal_dcir_main(CIRData)
        # 计算cir图，保存到本地
        self.save_to_csv(diffCIR, AUDIO_FILE)

    def cal_dcir_main(self, CIRData):
        diffCIR = np.zeros_like(CIRData)
        for j in range(1,CIRData.shape[0]):
            diffCIR[j,:] =CIRData[j,:] - CIRData[j-1,:]

        # 检查 diffCIR 是否全为 0
        if np.all(diffCIR == 0):
            return diffCIR

        # 归一化
        new_mean = np.mean(diffCIR)
        new_mean = np.mean(diffCIR[diffCIR > new_mean])
        end_value = np.mean(diffCIR[diffCIR > new_mean])
        diffCIR = np.interp(diffCIR, (diffCIR.mean(), end_value), (0, 1))
        CIRData = np.interp(CIRData, (CIRData.min(), CIRData.max()), (0, 1))
        return diffCIR

    def save_to_csv(self, diffCIR, AUDIO_FILE):
        fig, ax = plt.subplots()
        ax.imshow(diffCIR.T)
        ax.axis('off')  # 关闭坐标轴
        plt.savefig(AUDIO_FILE + 'cir_image.png', dpi=300, bbox_inches='tight', pad_inches=0)  # 保存图片，设置分辨率为300dpi，并且裁剪空白区域s
        print("++++++++++++++++++++++++++++++++" + AUDIO_FILE + 'cir_image.png')
        plt.close()

    def pre_data(self, AUDIO_DATA):
        # 下載波
        R_data = AUDIO_DATA
        fc = 20000
        fs = 48000
        t = np.arange(0, len(R_data)/fs, 1/fs)  # 时间轴
        angle = 2 * np.pi * fc * t
        real = np.cos(angle) * np.sqrt(2) * R_data
        Y_data = real.tolist()
        # 低通濾波
        Y_data = np.array(Y_data)
        fs = 48000
        wn1 = 2*4000/2/fs
        b, a = signal.butter(6,  wn1, 'lowpass')
        Y_data = signal.filtfilt(b,a,np.array(Y_data))
        Y_data = Y_data / np.max(Y_data)
        # 找最开始值
        tmp_data = Y_data[:600*10]
        start_index = np.argmax(np.correlate(tmp_data, self.standard_wave))
        if len(Y_data) - start_index < len(self.standard_wave):
            start_index = 0
        Y_data=Y_data[start_index:]
        return Y_data

    def cal_cir_main(self, Y_data):
        # 计算cir
        L=140
        P=312 - L
        reseult_matrix = self.cal_cir_matrix(self.GSM_upsample,L, P)
        frame_num = int(Y_data.size / 600)
        Y_data = Y_data[:frame_num*600]
        cir_list = []
        for i in range(frame_num):
            start_index = i*600
            frame_data = Y_data[start_index:start_index+600]
            RESULT = self.cal_cir(reseult_matrix, frame_data,L, P)
            cir_list.append(list(RESULT))
        CIRData = np.array(cir_list)
        return CIRData

    def cal_cir_matrix(self, origin_data, L, P):# reference length P(求解的参数个数); channel memory L(求解的cir值的个数)
        train_matrix = []
        for i in range(P):
            train_matrix.append(list(origin_data[i:L + i]))    # 用切片方法时，最后一个数据取不到
        train_matrix = np.matrix(train_matrix)
        reseult_matrix = (train_matrix.T *train_matrix).I *  train_matrix.T
        return reseult_matrix

    def cal_cir(self, reseult_matrix,record_data, L, P=0):# reference length P; channel memory L
        record_data = np.array(record_data)
        record_matrix =  np.matrix(record_data[L:L+P]).T  # L-1:L+P-1]
        result = np.dot(reseult_matrix, record_matrix)
        return np.array(result).flatten()[::-1]
    